window.onload=(()=>{$("#button").mousedown(function(o){switch(o.which){case 2:location.href="?click=success";break;default:alert("Please click the button with your scroll wheel!")}});const o=window.location.search;"success"===new URLSearchParams(o).get("click")&&($("#button").remove(),$("#button-col").append("<p>Thank you!</p>"),setTimeout(()=>{location.href="consent.html".concat(o)},1000))});